import React from "react";



const Createnote=()=>{


    return(
        <>
<div className="notedesign">
<form>
<input type="text" placeholder="enter your plantitle"/>
<textarea type="text" placeholder="enter your plan detail" />
<button>submit</button>

</form>
</div>


        </>

    )
}
export default Createnote;
